import ReactPaginate from 'react-paginate';

const Paginations = () => {
    const handlePageClick = () => {

    }

    const pageCount = 500

    return (
        <ReactPaginate
            breakLabel="..."
            nextLabel="next >"
            onPageChange={handlePageClick}
            pageRangeDisplayed={5}
            pageCount={pageCount}
            previousLabel="< previous"
            renderOnZeroPageCount={null}
        />
    )
}

export default Paginations
